import * as React from "react";
import { Image } from "expo-image";
import { useEffect, useState } from "react";
import {
  StyleSheet,
  View,
  TextInput,
  Button,
  Text,
  Pressable,
  TouchableOpacity,
} from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import { useNavigation } from "@react-navigation/native";
import VehicleCarousel from "../components/VehicleCarousel";
import { Color, Border, Padding, FontFamily, FontSize } from "../GlobalStyles";
import { TouchableWithoutFeedback } from "react-native";
import Footer from "../components/Footer";
import * as Svg from "react-native-svg";
import { LineChart } from "react-native-chart-kit";
import HomeVehicleTypes from "../components/HomeVehicleTypes";
import ProfilePopDown from "../components/ProfilePopDown";
import DashboardGraph from "../components/DashboardGraph";
import axios from "axios";
import Config from "./Config";
import AsyncStorage from "@react-native-async-storage/async-storage";
const Home = () => {
  const navigation = useNavigation();
  const [totalEmployees, setTotalEmployees] = useState(0);
  const [invoiceDues, setInvoiceDues] = useState(0);
  const invoices = null;

  const data = [10, 20, 5, 25, 15, 30, 12];

  const getEmployee = async () => {
    const Business_id = await AsyncStorage.getItem("Business_id");

    let config = {
      method: "get",
      maxBodyLength: Infinity,
      url: `${Config.apiServerUrl}/api/users/get-employees/${Business_id}`,
      headers: {},
    };

    axios
      .request(config)
      .then((response) => {
        console.log(JSON.stringify(response.data));
        setTotalEmployees(response.data.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const getInvoiceDue = async () => {
    const Business_id = await AsyncStorage.getItem("Business_id");
    let token = await AsyncStorage.getItem("accessToken");
    const accessToken = "Bearer " + token;

    if (Business_id) {
      let config = {
        method: "get",
        maxBodyLength: Infinity,
        url: `${Config.apiServerUrl}/api/invoice/${Business_id}/invoiceDue`,
        headers: {
          Authorization: accessToken,
        },
      };

      axios
        .request(config)
        .then((response) => {
          console.log(JSON.stringify(response.data));
          setInvoiceDues(response.data.data);
        })
        .catch((error) => {
          console.log(error);
        });
    }
  };

  useEffect(() => {
    getEmployee();
    getInvoiceDue();
  });

  return (
    <View style={styles.home}>
      <Image
        style={[styles.lightTexture22341Icon, styles.iconPosition1]}
        contentFit="cover"
        source={require("../assets/light-texture2234-1.png")}
      />

      <View style={[styles.homeChild, styles.homeLayout]} />
      <Text style={[styles.text, styles.textTypo1]}>{invoiceDues}</Text>
      <Text style={[styles.paymentDues, styles.paymentDuesPosition]}>
        Payment Dues
      </Text>
      <Image
        style={[styles.alertTriangle1Icon, styles.iconLayout3]}
        contentFit="cover"
        source={require("../assets/alerttriangle-1.png")}
      />
      <View style={[styles.homeItem, styles.homeLayout]} />
      <Text style={[styles.totalEmployees, styles.groupChild4Layout]}>
        Total Employees
      </Text>
      <View style={styles.wrapper}>
        <Text style={[styles.text1, styles.text1Typo]}>{totalEmployees}</Text>
      </View>
      <View style={[styles.rectangleParent, styles.groupChildLayout2]}>
        <Pressable
          style={[styles.groupChild, styles.groupChildLayout2]}
          onPress={() => navigation.navigate("MaintenanceRecord")}
        />
        <TextInput
          style={[styles.searchRecordAbc123, styles.text1Typo]}
          placeholder="Search Record"
        />
        <Pressable
          style={styles.vector}
          onPress={() => navigation.navigate("MaintenanceRecord")}
        >
          <Image
            style={[styles.icon, styles.iconLayout1]}
            contentFit="cover"
            source={require("../assets/vector8.png")}
          />
        </Pressable>
      </View>
      <View style={[styles.homeInner, styles.homeInnerLayout]}>
        <DashboardGraph />
        <TouchableOpacity
          style={[styles.createInvoiceWrapper, styles.invoicesChild3Layout]}
          onPress={() => navigation.navigate("SalesReport")}
        >
          <Text style={[styles.createInvoice, styles.text13Typo]}>
            Generate Report
          </Text>
        </TouchableOpacity>
      </View>

      {/* car , bike, auto.. */}

      {/* <HomeVehicleTypes /> */}
      <View style={styles.container}>
        <VehicleCarousel />
      </View>

      <Image
        style={[styles.users1Icon, styles.iconLayout3]}
        contentFit="cover"
        source={require("../assets/users-1.png")}
      />

      <View style={[styles.homeChild7, styles.homeChildShadowBox]} />
      <View style={[styles.homeChild8, styles.childPosition]}></View>

      <View style={[styles.cont]}>
        <Footer prop={"Home"} data={invoices} />
      </View>
    </View>
  );
};

